script: |
  super -f text -I q10800.spq | sort > q10800.out

inputs:
  - name: q10800.spq
    data: |
      SELECT DISTINCT - 44 / - col2, - ( - 14 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE + ( 94 ) NOT IN ( + + col0 * - col2 );
  - name: tab2

outputs:
  - name: q10800.out
    data: |
      0	14
      1	14
